import styled from "styled-components";

export const NavDiv = styled.div`
    display: flex;
    flex-flow: row;
    width: 100%;
`

export const MenuItem = styled.span`
    width: 167px;
    height: 57px;
    background: #2C2F36;
    border-box: none;
    border-radius: 10%;
`
